  \"Superconducting Electric Boost Pump for Nuclear Thermal Propulsion Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 6,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-07T01:20:52.881175\",\n\t\"name\": \"superconducting-electric-boost-pump-for-nuclear-thermal-propulsion-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A submersible, superconducting electric
  boost pump sized to meet the needs of future Nuclear Thermal Propulsion systems
  in the 25,000 lbf thrust range is proposed.  The proposed solution combines active
  electronic speed control technology with state-of-the-art cavitation suppression
  techniques to meet the near-zero Net Positive Suction Head requirements with up
  to 50&#37; vapor content and enables a higher level of safety, reliability and operability
  for the Nuclear Thermal Propulsion (NTP) system than turbine driven pumps.  The
  proposed pump configuration enables placement in, or close-coupled to the tank where
  it can be shielded from the reactor to prevent neutron flux heating.   Evaluation
  of NTP power cycles will enable feasibility determination for driving the boost
  pump, and possibly the main pump, electrically and provides a comparison of approaches
  for the derivation of requirements needed in the development of an ultra-long life,
  highly reliable integrated pump system for NTP.  The requirements, system trades
  and benefits analysis, conceptual design, risk reduction and Phase II planning will
  be documented to enable further development and TRL transition from TRL 3 at the
  completion of Phase I to TRL 5 at the completion of Phase II.\",\n\t\"license_title\":
